import React, { Component } from 'react'
import Todo from './Todo';

export class TodoList extends Component {
    constructor(props) {
        super(props)

        this.state = {
             todos: ["Eat", "Sleep", "Breathe"]
        }
    }


    render() {
        let todos = this.state.todos.map((e, ind) => (
            <Todo task={e} index={ind}/>
        ))
        return (
            <div>
                <ul>
                    {todos}
                </ul>

            </div>
        )
    }
}

export default TodoList
